import React, {Component} from 'react';

class Register extends Component {
	constructor(){
		super();
		this.state = {
			username:'',
			password:'',
			name:'',
			municipality:'',
			barrio: ''
		}
	}
	getMunicipalities = async()=>{
		try{
			const response = await fetch('http://localhost:9000/api/v1/auth/municipality')
			if(response.status !== 200){
        	// for http errors, Fetch doesn't reject the promise on 404 or 500
        	throw Error(response.statusText);
      		}
      		const municipalitiesParsed = await response.json();
      		this.setState({
      			municipality: municipalitiesParsed.data
      		})
		}catch(err){
			console.log(err);
		}
	}
	handleChange = (e)=>{
		console.log('handleChange has been called');
	}
	handleSubmit = (e)=>{
		console.log('handleSubmit has been called');

	}
	render(){
		return (
			<div>
			<h1>Register</h1>
			<form>
			Username:
			<input type="text" name='username' onChange={this.handleChange}/><br/>
			Password:
			<input type="password" name='password' onChange={this.handleChange}/><br/>
			Full Name:
			<input type='text' name='name' onChange={this.handleChange}/><br/>
			Municipality:
			<select name='municipality'>
			<option name='municipalities' value='municipalities'></option>
			</select><br/>
			Barrio:
			<select name='barrio'>
			<option name='barrios' value='barrios'></option>
			</select>
			</form>
			</div>
			)
	}
}


export default Register;
